import React from "react";

import { GrFormClose } from "react-icons/gr";

const SharedModal = ({ video_src, closeModal }) => {
  return (
    <div className="fixed inset-0 flex justify-center z-10 bg-opacity-25 items-center">
      <div className="text-white bg-slate-500">
        <div
          className="flex justify-end my-5"
          onClick={() => closeModal(false)}
        >
          <GrFormClose size={40} />
        </div>

        <video
          className="rounded-3xl h-[80%] mx-auto"
          src={video_src}
          controls
        ></video>
      </div>
    </div>
  );
};

export default SharedModal;
